import React from 'react';
import { View, StyleSheet, StatusBar, SafeAreaView, ImageBackground, TextInput, } from "react-native";
import { ScrollView, Text } from 'react-native-web';

function CardUsuario({ usuario }) {
    return (
        <ScrollView>
        <View style={styles.view}>
            <Text>{usuario.nome}</Text>
            <Text>{usuario.data_de_nasc}</Text>
            <Text>{usuario.email}</Text>
            <Text>{usuario.celular}</Text>
        </View>
        </ScrollView>
    );
}

export default CardUsuario;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#F0F0F5'
    },

    view: {
        padding: 15,
        alignItems: 'center',
        backgroundColor: 'red',
        borderRadius: 15,
        marginVertical: 10,
        marginLeft: 20,
        marginRight: 20
    },
});
